import path from 'path'

import webpack from 'webpack'
import HtmlWebpackPlugin from 'html-webpack-plugin'
// import { CleanWebpackPlugin } from 'clean-webpack-plugin'
// import ManifestPlugin from 'webpack-manifest-plugin'
// import MiniCssExtractPlugin from 'mini-css-extract-plugin'
// import { BundleAnalyzerPlugin } from 'webpack-bundle-analyzer'
// import OptimizeCssAssetsPlugin from 'optimize-css-assets-webpack-plugin'
// import cssnano from 'cssnano'

const isProd = process.env.NODE_ENV === 'production'

module.exports = {
  devServer: {
    historyApiFallback: true,
    contentBase: path.join(__dirname, 'dist'),
    compress: true,
    port: 9000,
    host: 'localhost',    
  },
  entry: './src/index.js',
  output: {
    path: `${__dirname}/dist`,
    publicPath: '/',
    filename: isProd ? '[name].[hash].js' : '[name].bundle.js',
    chunkFilename: isProd ? '[name].js' : '[name].bundle.js',
  },
  devtool: isProd ? 'source-map' : 'eval-source-map',
  optimization: {
    splitChunks: {
      chunks: 'all',
      minSize: 100,
      maxSize: 0,
      minChunks: 1,
    },
    // https://webpack.js.org/guides/tree-shaking/
    usedExports: true, // could help but not necessary, is used by 3rd party plugins/optomizers
  },
  // resolve: {
  //   alias: {
  //     'react-spring$': 'react-spring/web.cjs',
  //     'react-spring/renderprops$': 'react-spring/renderprops.cjs',
  //     'core-ui': path.resolve(__dirname, './packages/ui/src'),
  //     'core-utils': path.resolve(__dirname, './packages/utils/src'),
  //   },
  //   extensions: ['.js', '.jsx', '.tsx', '.ts', '.json'],
  // },
  module: {
    rules: [
      {
        test: /\.(js|jsx|ts|tsx)$/,
        exclude: /(node_modules)/,
        use: [
          {
            loader: 'babel-loader',
            options: {
              configFile: path.resolve(__dirname, '.babelrc.json'),
            },
          },
        ],
      },
      // {
      //   test: /\.css?$/,
      //   use: [
      //     // 'style-loader',
      //     MiniCssExtractPlugin.loader,
      //     {
      //       loader: 'css-loader',
      //       options: {
      //         sourceMap: true,
      //       },
      //     },
      //     'resolve-url-loader',
      //   ],
      // },
      // {
      //   test: /\.scss/,
      //   use: [
      //     // 'style-loader',
      //     MiniCssExtractPlugin.loader,
      //     {
      //       loader: 'css-loader',
      //       options: {
      //         sourceMap: true,
      //       },
      //     },
      //     {
      //       loader: 'resolve-url-loader',
      //     },
      //     {
      //       loader: 'sass-loader',
      //       options: {
      //         sourceMap: true,
      //       },
      //     },
      //   ],
      // },
      // {
      //   test: /\.woff(\?v=\d+\.\d+\.\d+)?$/,
      //   use: 'file-loader?limit=100000&mimetype=application/font-woff',
      // }, {
      //   test: /\.woff2(\?v=\d+\.\d+\.\d+)?$/,
      //   use: 'file-loader?limit=100000&mimetype=application/font-woff',
      // }, {
      //   test: /\.ttf(\?v=\d+\.\d+\.\d+)?$/,
      //   use: 'file-loader?limit=100000&mimetype=application/octet-stream',
      // }, {
      //   test: /\.eot(\?v=\d+\.\d+\.\d+)?$/,
      //   use: 'file-loader?limit=100000&mimetype=application/font-eot',
      // },
      // {
      //   test: /\.otf(\?v=\d+\.\d+\.\d+)?$/,
      //   use: 'file-loader?limit=100000&mimetype=application/font-otf',
      // },
      // {
      //   // IMAGE LOADER
      //   test: /\.(jpe?g|png|gif|svg|ico)$/i,
      //   use: [
      //     {
      //       loader: 'file-loader',
      //       options: {
      //         outputPath: 'images',
      //       },
      //     },
      //   ],
      // },
    ],
  },
  plugins: [
    // new MiniCssExtractPlugin({
    //   // filename: '[name].css',
    //   // chunkFilename: '[id].css',
    //   filename: isProd ? '[name].[hash].css' : '[name].bundle.css',
    //   chunkFilename: isProd ? '[name].[contenthash].css' : '[name].bundle.css',
    // }),
    // new OptimizeCssAssetsPlugin({
    //   assetNameRegExp: /\.optimize\.css$/g,
    //   cssProcessor: cssnano,
    //   cssProcessorPluginOptions: {
    //     preset: ['default', { discardComments: { removeAll: true } }],
    //   },
    //   canPrint: true,
    // }),
    new HtmlWebpackPlugin({
      template: './src/index.html',
      // favicon: '../app/assets/images/favicon-32x32.png',
      filename: 'index.html',
      inject: 'body',
      chunksSortMode: 'none',
    }),
    // new ManifestPlugin(),
    // new webpack.DefinePlugin({
    //   SC_DISABLE_SPEEDY: true,
    // }),
  ].concat(!isProd ? [] : [
    new webpack.DefinePlugin({
      'process.env': {
        NODE_ENV: JSON.stringify('production'),
      },
      PRODUCTION: JSON.stringify('production'),
    }),
  ].concat(
    isProd && process.env.ANALYZE
      ? [
        new BundleAnalyzerPlugin(),
      ]
      : [],
  )),
}
